import React from "react";
import ReactDOM from "react-dom/client";
import './index.css';

class ShoppingList extends React.Component{
    render() {
        return(
            <div classname="shopping-list">
                <h1>Shopping list for {this.props.name}</h1>
                <ul>
                    <li>pancakes</li>
                </ul>
            </div>
        );
    }
}
